import React from 'react';
import './App.css';
import Fragment from 'render-fragment';


class App extends React.Component {


  render() {
    return (
      <Fragment>
      <button className="square" onClick={() => alert('click')}>
        Bonjour, {this.props.name}
      </button>
    <div>  { this.props.nombre } </div>
    </Fragment>
    );
  }

}


export default App;
